  const navigate = useNavigate()
  console.log(currentUser)

  useEffect(() => {
    if (!isLoggedIn) navigate('/login')
  }, [])

  return <>
    <div className='userDetailsContainer'>
      <div className='userGreeting'>{`Hello ${currentUser}`}</div>


    </div>
  </>
}

export default Profile;
